
using DC.DigitalSignature.Core;
using DC.DigitalSignature.Core.Models;
using Microsoft.AspNetCore.Mvc;

namespace dc.digitalsignature.api.Controllers
{
    [Route("api/file")]
    [ApiController]
    public class FileController : ControllerBase
    {

        private readonly ILogger<FileController> _logger;
        private readonly IFileService _fileService;

        public FileController(ILogger<FileController> logger, IFileService fileService)
        {
            _logger = logger;
            _fileService = fileService;
        }

        [HttpPost("sign")]
        public ResponseModel Sign(SignatureModel model)
        {
            var result = _fileService.Sign(model);
            return result;
        }
    }
}

